r": null}, {"end": 752.45, "text": "I didn't even realize it.", "start": 751.25, "speaker": null}, {"end": 757.49, "text": "I thought I was helping myself by like focusing on myself but really I'd been too.", "start": 752.25, "speaker": null}], "structure": 0.5, "vision_focus": 0.0}	Quotable	2025-11-15 22:24:57.141	Shift from self-pity to self-love with gratitude.	Shifting from Self-Pity to Self-Love Through Gratitude	16:9	\N	\N	\N
