 stopped on the street every day, and people don't come up and say, oh, I like your show, or", "start": 542.119, "speaker": null}, {"end": 546.8000000000001, "text": "Come up and go, you changed my life.", "start": 545.48, "speaker": null}, {"end": 548.2, "text": "Oh, my God, I love you, Tony Robbins.", "start": 546.6, "speaker": null}, {"end": 549.6800000000001, "text": "And I always say, no, I didn't do it.", "start": 548.0, "speaker": null}, {"end": 550.16, "text": "You did it.", "start": 549.48, "speaker": null}, {"end": 551.24, "text": "But I'm glad I helped.", "start": 549.9599999999999, "speaker": null}, {"end": 553.08, "text": "But I love the love that comes from it.", "start": 551.04, "speaker": null}, {"end": 553.49, "text": "Yeah.", "start": 552.88, "speaker": null}, {"end": 556.13, "text": "So we all really want love, but we're afraid we're not enough.", "start": 553.29, "speaker": null}], "structure": 0.5, "vision_focus": 0.0}	Quotable	2025-11-15 22:24:57.141	Discovering purpose through helping others overcome depression.	Finding Purpose Through Helping Others	16:9	\N	\N	\N
