": null}, {"end": 491.93, "text": "Because I was so unhappy myself, and I got out of it.", "start": 488.69, "speaker": null}, {"end": 493.05, "text": "So I was so grateful.", "start": 491.72999999999996, "speaker": null}, {"end": 493.73, "text": "It's like I don't.", "start": 492.84999999999997, "speaker": null}, {"end": 496.82000000000005, "text": "It's like, you know, I feed, you know, 100 million people a year.", "start": 493.53, "speaker": null}, {"end": 497.46000000000004, "text": "100 million meals.", "start": 496.62, "speaker": null}, {"end": 497.90000000000003, "text": "Yeah.", "start": 497.26, "speaker": null}, {"end": 498.3, "text": "Charity.", "start": 497.7, "speaker": null}, {"end": 498.62, "text": "Yeah.", "start": 498.09999999999997, "speaker": null}, {"end": 500.94, "text": "I've done a billion meals in the last eight years.", "start": 498.41999999999996, "speaker": null}, {"end": 501.34000000000003, "text": "Right?", "start": 500.73999999999995, "speaker": null}, {"end": 502.3, "text": "Dude, that's almost.", "start": 501.14, "speaker": null}, {"end": 502.78000000000003, "text": "That's what.", "start": 502.09999999999997, "speaker": null}, {"end": 504.62, "text": "That's what McDonald's did, isn't it?", "start": 502.58, "speaker": null}], "structure": 0.5, "vision_focus": 0.0}	High engagement	2025-11-15 22:24:57.141	Exploring emotions from joy to love.	Exploring Emotions: From Joy to Love	16:9	\N	\N	\N
