.10000000000001, "speaker": null}, {"end": 106.1, "text": "He was my best friend.", "start": 104.26, "speaker": null}, {"end": 108.22, "text": "But then I just fell in love with him.", "start": 105.9, "speaker": null}], "structure": 0.5, "vision_focus": 0.0}	Quotable	2025-11-16 12:29:12.309	Nostalgic reflection on youth and freedom.	Wishing for Youth: Fun, Friends, and Freedom	16:9	\N	\N	\N
df41c251-0673-4a27-9877-d43c165c0ed6	cmi1ozejq000b10w9g2o69fdx	116.83	164.59	47.760000000000005	83	{"hook": 0.3, "quote": 0.8, "clarity": 1.0, "emotion": 0.0, "novelty": 0.029850746268656716, "segments": [{"end": 120.28999999999999, "text": "Oh, I'm going to ask him to marry me.", "start": 116.73, "speaker": null}, {"end": 122.00999999999999, "text": "Did you fall in love?", "start": 120.09, "speaker": null}, {"end": 123.00999999999999, "text": "What was it like?", "start": 121.81, "speaker": null}, {"end": 124.44999999999999, "text": "Well, I fell in love a few times.", "start": 122.81, "speaker": null}, {"end": 129.25, "text": "But when I fell in love with Colm, that's my husband outside, it was fabulous.", "start": 124.25, "speaker": null}, {"end": 131.48999999999998, "text": "He's a very funny man and he makes me laugh.", "start": 129.05, "speaker": null}, {"end": 132.69, "text": "And he still makes me laugh.", "start": 131.29, "speaker": null}, {"end": 135.41, "text": "And that's what I love about him still.", "start": 132.49, "speaker": null}, {"end": 137.2, "text": "Does getting old scare you?", "start": 135.21, "speaker": null}, {"end": 138.0, "text": "No.", "start": 137.0, "speaker": null}, {"end": 139.51999999999998, "text": "Why do you think it doesn't scare you?", "start": 137.8, "speaker": null}, {"end": 145.28, "text": "I don't wish to be old right straight away, but I do want to be old, but I don't wish to", "start": 139.32, "speaker": null}, {"end": 146.07999999999998, "text": "be old straight away.", "start": 145.08, "speaker": null}, {"end": 148.23999999999998, "text": "Does getting older scare you?", "start": 145.88, "speaker": null}, {"end": 151.07999999999998, "text": "Yeah, getting old does scare me a bit.", "start": 148.04, "speaker": null}, {"end": 156.44, "text": "When you get older, you get more sick and you're not as quick on your feet.", "start": 150.88, "speaker": null}, {"end": 160.64, "text": "You can't run and you can't do loads of things that you used to be able to do.", "start": 156.24, "speaker": null}, {"end": 162.48, "text": "Yeah, getting old is scarier.", "start": 160.44, "speaker": null}, {"end": 163.25, "text": "It is.", "start": 162.28, "speaker": null}, {"end": 164.69, "text": "Without a shadow of a doubt.", "start": 163.05, "speaker": null}], "structure": 0.5, "vision_focus": 0.0}	Quotable	2025-11-16 12:29:12.309	Woman shares humorous and heartwarming story of falling in love and marrying...	Falling in Love and Marrying Colm | Funny and Fabulous	16:9	\N	\N	\N
