 "start": 103.10000000000001, "speaker": null}, {"end": 106.1, "text": "He was my best friend.", "start": 104.26, "speaker": null}, {"end": 108.22, "text": "But then I just fell in love with him.", "start": 105.9, "speaker": null}, {"end": 116.92999999999999, "text": "When the time comes where you're allowed to ask boys or girls, would they want to marry you?", "start": 108.02000000000001, "speaker": null}], "structure": 0.5, "vision_focus": 0.0}	Quotable	2025-11-12 14:28:46.368	Longing for youth: reminiscing on carefree days with friends and freedom.	Wishing for Youth: Fun, Friends, and Freedom	16:9	\N	\N	\N
da83841d-cb3a-467d-a2d3-f0c5aa04e2ad	cmhw3hen50001kya1i1elnddf	116.83	164.59	47.760000000000005	83	{"hook": 0.3, "quote": 0.8, "clarity": 1.0, "emotion": 0.0, "novelty": 0.02973977695167286, "segments": [{"end": 120.28999999999999, "text": "Oh, I'm going to ask him to marry me.", "start": 116.73, "speaker": null}, {"end": 122.00999999999999, "text": "Did you fall in love?", "start": 120.09, "speaker": null}, {"end": 123.00999999999999, "text": "What was it like?", "start": 121.81, "speaker": null}, {"end": 124.44999999999999, "text": "Well, I fell in love a few times.", "start": 122.81, "speaker": null}, {"end": 129.25, "text": "But when I fell in love with Colm, that's my husband outside, it was fabulous.", "start": 124.25, "speaker": null}, {"end": 131.48999999999998, "text": "He's a very funny man and he makes me laugh.", "start": 129.05, "speaker": null}, {"end": 132.69, "text": "And he still makes me laugh.", "start": 131.29, "speaker": null}, {"end": 135.41, "text": "And that's what I love about him still.", "start": 132.49, "speaker": null}, {"end": 137.2, "text": "Does getting old scare you?", "start": 135.21, "speaker": null}, {"end": 138.0, "text": "No.", "start": 137.0, "speaker": null}, {"end": 139.51999999999998, "text": "Why do you think it doesn't scare you?", "start": 137.8, "speaker": null}, {"end": 145.28, "text": "I don't wish to be old right straight away, but I do want to be old, but I don't wish to", "start": 139.32, "speaker": null}, {"end": 146.07999999999998, "text": "be old straight away.", "start": 145.08, "speaker": null}, {"end": 148.23999999999998, "text": "Does getting older scare you?", "start": 145.88, "speaker": null}, {"end": 151.07999999999998, "text": "Yeah, getting old does scare me a bit.", "start": 148.04, "speaker": null}, {"end": 156.44, "text": "When you get older, you get more sick and you're not as quick on your feet.", "start": 150.88, "speaker": null}, {"end": 160.64, "text": "You can't run and you can't do loads of things that you used to be able to do.", "start": 156.24, "speaker": null}, {"end": 162.48, "text": "Yeah, getting old is scarier.", "start": 160.44, "speaker": null}, {"end": 163.25, "text": "It is.", "start": 162.28, "speaker": null}, {"end": 164.69, "text": "Without a shadow of a doubt.", "start": 163.05, "speaker": null}], "structure": 0.5, "vision_focus": 0.0}	Quotable	2025-11-12 14:28:46.368	Heartwarming love story unfolds through marriage proposal and aging reflections.	Marriage Proposal, Falling in Love, Aging Gracefully	16:9	\N	\N	\N
604d8b44-3a70-47e6-a7b4-a7827b96a3cc	cmhw3hen50001kya1i1elnddf	1.92	43.02	41.1	83	{"hook": 0.3, "quote": 0.8, "clarity": 1.0, "emotion": 0.0, "novelty": 0.026022304832713755, "segments": [{"end": 7.38, "text": "What do we talk about?", "start": 1.8199999999999998, "speaker": null}, {"end": 10.26, "text": "My name is Maria.", "start": 7.180000000000001, "speaker": null}, {"end": 11.219999999999999, "text": "How are you?", "start": 10.06, "speaker": null}, {"end": 13.299999999999999, "text": "My name's Lucia.", "start": 11.02, "speaker": null}, {"end": 13.94, "text": "Lucia.", "start": 13.1, "speaker": null}, {"end": 14.78, "text": "And that's a beautiful name.", "start": 13.74, "speaker": null}, {"end": 16.02, "text": "And you're a gorgeous looking girl.", "start": 14.58, "speaker": null}, {"end": 18.42, "text": "What's the best thing about being old?", "start": 15.82, "speaker": null}, {"end": 21.3, "text": "People are nicer to you when you're older.", "start": 18.22, "speaker": null}, {"end": 23.060000000000002, "text": "I don't really think to be quite true.", "start": 21.099999999999998, "speaker": null}, {"end": 25.18, "text": "There's an awful lot going for being older.", "start": 22.86, "speaker": null}, {"end": 25.860000000000003, "text": "Will you swap?", "start": 24.979999999999997, "speaker": null}, {"end": 28.400000000000002, "text": "Well, I would swap with you in a heartbeat.", "start": 25.66, "speaker": null}, {"end": 32.24, "text": "Don't even know how you could swap in an absence.", "start": 28.2, "speaker": null}, {"end": 33.28, "text": "No, I don't know either.", "start": 32.04, "speaker": null}, {"end": 34.4, "text": "But it'd be nice, wouldn't it?", "start": 33.08, "speaker": null}, {"end": 35.2, "text": "We could swap around.", "start": 34.199999999999996, "speaker": null}, {"end": 37.52, "text": "If I could be you for a few days and you could be me.", "start": 35.0, "speaker": null}, {"end": 41.32, "text": "You'd have to go home and cook the dinner and look after the dog.", "start": 37.32, "speaker": null}, {"end": 42.399, "text": "I have a beautiful dog.", "start": 41.12, "speaker": null}, {"end": 43.120000000000005, "text": "Would you like that?", "start": 42.199, "speaker": null}], "structure": 0.5, "vision_focus": 0.0}	Quotable	2025-11-12 14:28:46.368	Heartwarming chat about aging and exchanging lives.	Charming conversation about aging and swapping lives	16:9	\N	\N	\N
e3fedb0f-8eee-46f8-8ac1-dc8c34911091	cmhw3hen50001kya1i1elnddf	18.32	78.03	59.71	83	{"hook": 0.3, "quote": 0.8, "clarity": 1.0, "emotion": 0.0, "novelty": 0.026022304832713755, "segments": [{"end": 21.3, "text": "People are nicer to you when you're older.", "start": 18.22, "speaker": null}, {"end": 23.060000000000002, "text": "I don't really think to be quite true.", "start": 21.099999999999998, "speaker": null}, {"end": 25.18, "text": "There's an awful lot going for being older.", "start": 22.86, "speaker": null}, {"end": 25.860000000000003, "text": "Will you swap?", "start": 24.979999999999997, "speaker": null}, {"end": 28.400000000000002, "text": "Well, I would swap with you in a heartbeat.", "start": 25.66, "speaker": null}, {"end": 32.24, "text": "Don't even know how you could swap in an absence.", "start": 28.2, "speaker": null}, {"end": 33.28, "text": "No, I don't know either.", "start": 32.04, "speaker": null}, {"end": 34.4, "text": "But it'd be nice, wouldn't it?", "start": 33.08, "speaker": null}, {"end": 35.2, "text": "We could swap around.", "start": 34.199999999999996, "speaker": null}, {"end": 37.52, "text": "If I could be you for a few days and you could be me.", "start": 35.0, "speaker": null}, {"end": 41.32, "text": "You'd have to go home and cook the dinner and look after the dog.", "start": 37.32, "speaker": null}, {"end": 42.399, "text": "I have a beautiful dog.", "start": 41.12, "speaker": null}, {"end": 43.120000000000005, "text": "Would you like that?", "start": 42.199, "speaker": null}, {"end": 47.28, "text": "I'd like it when I'm an adult, but not when I'm still a child.", "start": 42.92, "speaker": null}, {"end": 47.96, "text": "When you're seven.", "start": 47.08, "speaker": null}, {"end": 48.72, "text": "That's lovely.", "start": 47.76, "speaker": null}, {"end": 50.480000000000004, "text": "What's the best thing about being young?", "start": 48.519999999999996, "speaker": null}, {"end": 55.410000000000004, "text": "Do you get to play with your friends and play with your best friends?", "start": 50.28, "speaker": null}, {"end": 56.85, "text": "And who's your best friend?", "start": 55.21, "speaker": null}, {"end": 59.25, "text": "I actually have two best friends, Leo and Nader.", "start": 56.65, "speaker": null}, {"end": 67.89, "text": "Leo is a big brother that's kind of like a twin for me because he was born at the same day", "start": 59.05, "speaker": null}, {"end": 68.36999999999999, "text": "as me.", "start": 67.69000000000001, "speaker": null}, {"end": 70.21, "text": "But not for my mom.", "start": 68.17, "speaker": null}, {"end": 71.97, "text": "Do you wish you're young?", "start": 70.01, "speaker": null}, {"end": 72.44999999999999, "text": "Why?", "start": 71.77000000000001, "speaker": null}, {"end": 77.85, "text": "Oh, because when you're young, you have great times, you have loads and loads of friends and you're ", "start": 72.25, "speaker": null}], "structure": 0.5, "vision_focus": 0.0}	Quotable	2025-11-12 14:28:46.368	Discussing the idea of swapping lives for a day.	Fantasizing About Swapping Lives for a Day	16:9	\N	\N	\N
e25f117e-f635-4bbc-bccd-5c08106c8b23	cmhw3hen50001kya1i1elnddf	175.39	216.03	40.640000000000015	80	{"hook": 0.0, "quote": 0.8, "clarity": 1.0, "emotion": 0.2, "novelty": 0.04460966542750929, "segments": [{"end": 176.69, "text": "Can I copy that?", "start": 175.29, "speaker": null}, {"end": 177.32999999999998, "text": "Yeah.", "start": 176.49, "speaker": null}, {"end": 178.53, "text": "You go like this.", "start": 177.13, "speaker": null}, {"end": 179.81, "text": "You like this.", "start": 178.33, "speaker": null}, {"end": 181.41, "text": "That's making me dizzy.", "start": 179.61, "speaker": null}, {"end": 182.53, "text": "I don't think I can do that.", "start": 181.21, "speaker": null}, {"end": 193.25, "text": "The only thing I can tell you is to take every chance and every opportunity, enjoy everything and ha", "start": 182.33, "speaker": null}, {"end": 194.21, "text": "fabulous life.", "start": 193.05, "speaker": null}, {"end": 195.25, "text": "I will.", "start": 194.01000000000002, "speaker": null}, {"end": 199.17, "text": "And I hope you and Leo are going to be very, very, very happy.", "start": 195.05, "speaker": null}, {"end": 203.89, "text": "But enjoy life, that's the most important thing, to really, really enjoy life.", "start": 198.97, "speaker": null}, {"end": 206.13, "text": "So first you're looking.", "start": 203.69, "speaker": null}, {"end": 213.17, "text": "You're looking at your nose, and then you go, yeah, like that.", "start": 205.93, "speaker": null}, {"end": 216.13, "text": "Back to looking at your nose like that.", "start": 212.97, "speaker": null}], "structure": 0.0, "vision_focus": 0.0}	Quotable	2025-11-12 14:28:46.368	Learning to copy dance moves for a fabulous life.	Learning to Copy Dance Moves for Fun	16:9	\N	\N	\N
